INSERT INTO `wp_posts` VALUES("142", "1", "2024-01-06 10:05:32", "2024-01-06 03:05:32", "<h4 class=\"related_product_title\">Mô tả sản phẩm</h4>\r\nPhiên bản nâng cấp với trọng lượng tăng 80% so với bánh mì que thông thường, đem đến cho bạn bữa ăn nhanh gọn mà vẫn đầy đủ dinh dưỡng. Cắn một miếng là mê mẩn bởi vỏ bánh nướng giòn rụm, nhân đậm vị với từng miếng thịt gà mềm, ướp sốt kim quất chua ngọt, thơm nức đặc trưng. Càng \"đúng bài\" hơn khi thưởng thức kèm Cà phê đượm vị hoặc trà Hi-Tea thanh mát.", "Bánh Mì Gậy Gà Kim Quất", "<h4 class=\"related_product_title\">Mô tả sản phẩm</h4>\r\nPhiên bản nâng cấp với trọng lượng tăng 80% so với bánh mì que thông thường, đem đến cho bạn bữa ăn nhanh gọn mà vẫn đầy đủ dinh dưỡng. Cắn một miếng là mê mẩn bởi vỏ bánh nướng giòn rụm, nhân đậm vị với từng miếng thịt gà mềm, ướp sốt kim quất chua ngọt, thơm nức đặc trưng. Càng \"đúng bài\" hơn khi thưởng thức kèm Cà phê đượm vị hoặc trà Hi-Tea thanh mát.", "publish", "open", "closed", "", "banh-mi-gay-ga-kim-quat", "", "", "2024-01-06 10:05:32", "2024-01-06 03:05:32", "", "0", "https://codercoffee.io.vn/?post_type=product&#038;p=142", "0", "product", "", "0");
